- test_given_input:
    time_range_1: ["2010-01-12 10:00:00", "2010-01-12 12:00:00"]
    time_range_2: ["2010-01-12 10:30:00", "2010-01-12 10:45:00", 2, 60]
    expected:
        - ['2010-01-12 10:30:00', '2010-01-12 10:37:00'] 
        - ['2010-01-12 10:38:00', '2010-01-12 10:45:00']
- two_no_overlap:
    time_range_1: ["2010-01-12 11:00:00", "2010-01-12 12:00:00"]
    time_range_2: ["2010-01-12 10:30:00", "2010-01-12 10:45:00", 2, 60]
    expected: []
- two_several_interval:
    time_range_1: ["2010-01-12 10:00:00", "2010-01-12 14:00:00", 3, 1800]
    time_range_2: ["2010-01-12 10:30:00", "2010-01-12 10:45:00", 2, 60]
    expected:
        - ["2010-01-12 10:30:00", "2010-01-12 10:37:00"]
        - ["2010-01-12 10:38:00", "2010-01-12 10:45:00"]
- two_same_start_end:
    time_range_1: ["2010-01-12 10:00:00", "2010-01-12 12:00:00"]
    time_range_2: ["2010-01-12 12:00:00", "2010-01-12 13:00:00"]
    expected: []
